import Layout from "../components/Layout"
import Head from "next/head"
import Link from "next/link"

export default class Leaderboard extends React.Component{
  constructor(props){
    super(props)

    this.state = {
      loaded: false,
      servers: []
    }
  }

  parseLeaderboard(e){
    e.preventDefault()

    var id = document.getElementById('server-id').value
    this.getLeaderboard(id).then((leaderboard)=>{
      if (typeof leaderboard != 'object'){
        alert('Unknown Error ')
      }
    })
  }

  async getLeaderboard(id){
    var b = await fetch(`https://bread.pdaniely.repl.co/leaderboard?id=${id}`, {
      method: 'GET'
    })

    var j = await b.json()

    if(j.ok == false){
      alert(j.message)
      return
    }

    return j.leaderboard
  }


  render(){

  return (
    <Layout style={{ textAlign: 'center'}}>

      <style jsx>{`
        .server{
          display: inline-block;
          border: 2px solid;
          border-radius: 10px 10px;
          width: 230px;
          height: 320px;
          padding: 10px 10px;
          margin-left: 5px;
        }
      `}</style>
      <Head>
        <title>Bread - Leaderboard</title>
      </Head>

      <br/>
      <form onSubmit={this.parseLeaderboard}>
        <input type="search" placeholder="Server Name/ID" required />
      </form>

      <div id="leaderboard">
        <p>Enter server id in the textbox to get server</p>
      </div>
    </Layout>
  )
  }
}
